import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and locate the first video container with data-video-id='1'
    await page.waitForSelector('div.video-container[data-video-id="1"]');

    // Find the like button within the first video container
    const likeButton = await page.$('div.video-container[data-video-id="1"] button.like-btn');

    if (!likeButton) {
      throw new Error('Like button not found in the first video container');
    }

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_like.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_like.png'));

    // Click the like button
    await likeButton.click();

    // Wait for potential state changes
    await page.waitForTimeout(1000);

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_like.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_like.png'));

    return {
      success: true,
      action: "Clicked like button on first video (data-video-id='1') to change to liked state",
      extractedData: {
        videoId: '1',
        buttonClass: await likeButton.getAttribute('class'),
        buttonText: await likeButton.textContent()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first video container with data-video-id='1'
    await page.waitForSelector('div.video-container[data-video-id="1"]', { timeout: 5000 });

    // Wait for and click the like button using multiple selector strategies
    const likeButtonSelector = 'div.video-container[data-video-id="1"] button.like-btn';
    await page.waitForSelector(likeButtonSelector, { timeout: 5000 });

    // Take screenshot before clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_like.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_like.png'));

    // Click the like button
    await page.click(likeButtonSelector);

    // Wait for any potential state changes
    await page.waitForTimeout(1000);

    // Take screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_like.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_like.png'));

    // Extract data to verify the like action
    const likeState = await page.$eval(likeButtonSelector, btn => {
      return {
        className: btn.className,
        textContent: btn.textContent.trim(),
        isLiked: btn.classList.contains('active') || btn.classList.contains('liked')
      };
    });

    return {
      success: true,
      action: "Clicked like button on first video (data-video-id='1') to change to liked state",
      extractedData: {
        likeButtonState: likeState,
        videoId: '1',
        isLiked: likeState.isLiked
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and locate the first video container with data-video-id='1'
    const videoContainer = await page.waitForSelector('div[data-video-id="1"]');

    // Wait for and click the like button within the container
    const likeButton = await videoContainer.waitForSelector('button.like-btn');
    await likeButton.click();

    // Wait for state change and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_liked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_liked.png'));

    // Verify the like state by checking for active class
    const isLiked = await likeButton.evaluate(btn => btn.classList.contains('active'));

    return {
      success: true,
      action: "Clicked like button on first video (data-video-id='1')",
      extractedData: {
        videoId: '1',
        liked: isLiked
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
